import React, { Component } from 'react';
import {  Segment, Label } from "semantic-ui-react";

class Home extends Component{
  constructor(props){
    super(props);
  }
    render(){
      return(
        <div>
            <Segment inverted>
                <Label as="a" basic color="blue">
                  HOME
                </Label>
            </Segment>
        </div>
        );
    }
  }

export default Home;
